var formattedEvents = getArray();
var d = new Date();
for (i = 0; i < events.events.length; i++) {
  var eventObj = {};
  var e = events.events[i].event;

  var eventDate = e["occurred_at"];
  eventObj.event_date = d.toISOString(eventDate);

  var eventKind = e["event_type"];
  var n = eventKind.lastIndexOf("_");
  var eventObjType = "";

  var eventObjectType = eventKind.substring(0, n);
  if (eventObjectType === "pending_invoice") {
    eventObjType = "invoice";
    eventObj.event_object_type = eventObjType;
  } else if (eventObjectType === "credit_note") {
    eventObjType = "credit_note";
    eventObj.event_object_type = eventObjType;
  } else if (eventObjectType === "payment") {
    eventObjType = "transaction";
    eventObj.event_object_type = eventObjType;
  } else if (eventObjectType === "refund") {
    eventObjType = "transaction";
    eventObj.event_object_type = eventObjType;
  } else {
    eventObjType = eventKind.split('_')[0];
    eventObj.event_object_type = eventObjType;
  }

  try {
    eventObj.event_object_id = e["content"][eventObjType]["id"];
  } catch (ignoreerror) {}

  var eventType = eventKind.substring(n + 1, eventKind.length);
  if (eventType === 'created' || eventType === 'generated' || eventType === 'added') {
    eventObj.event_type = 'CREATED';
  } else if (eventType === 'updated' || eventType === 'changed' || eventType === 'started' || eventType === 'activated' || eventType === 'scheduled' || eventType === 'cancelled' || eventType === 'reactivated' || eventType === 'renewed' || eventType === 'removed' || eventType === 'succeeded' || eventType === 'failed' || eventType === 'refunded' || eventType === 'added' || eventType === 'reminder' || eventType === 'expired') {
    eventObj.event_type = 'UPDATED';
  } else if (eventType === 'deleted') {
    eventObj.event_type = 'DELETED';
  } else if (eventType === 'initiated') {
    eventObj.event_type = 'INIT';
  }
  formattedEvents.add(eventObj);
}
return {
  "events": formattedEvents
}
